import React from 'react';


function CalculatorButton({ buttonValue }) {
    return(
        <button text={ buttonValue }/>
    );
}

class App extends React.Component {
    render() {
      return (
        <div>
            <CalculatorButton buttonValue={'1'} />
        </div>
      );
    }
}

export default App;
